import React from 'react'
import './Footer.css'

export function Footer() {
    return (
        <div className='footer_wrapper'>
            <div className='footer_rule'><hr /></div>
            <div className='footer_row_bottom'><p>© 2008-2024. All rights reserved.</p></div>
        </div>
    )
}
